import React from 'react';
import logo from './logo.svg';
import './App.css';
import { CarosuelWithPhotos } from './CarosuelWithPhotos/CarosuelWithPhotos';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
      <CarosuelWithPhotos />
    </div>
  );
}

export default App;
